function showData(show) {

    if (show=="true") {

        document.getElementById("adminpane").style.display = "inline-block";
    }
    else {
        alert("Wrong Information Entered");
    }
}

function makeTable(name,type) {
    if (create == true) {
        var tbox = document.createElement("TABLE");
        tbox.setAttribute("id", "table");
        var row1 = document.createElement("TR");
        row1.setAttribute("width", "100%");
        row1.setAttribute("id","row1");
        var th1 = document.createElement("TH");
        var th2 = document.createElement("TH");
        var txt1 = document.createTextNode(name);
        var txt2 = document.createTextNode(type);
        th1.setAttribute("width", "20%");
        th2.setAttribute("width", "78%");
        th1.appendChild(txt1);
        th2.appendChild(txt2);
        row1.appendChild(th1);
        row1.appendChild(th2);
        tbox.appendChild(row1);
        var main = document.getElementById("adminwindow");
        main.appendChild(tbox);
        create = false;
        generateTable2(checkedtweets);
    }
}

function makecfmTable(name,type) {
    if (create2 == true) {
        var tbox = document.createElement("TABLE");
        tbox.setAttribute("id", "table");
        var row1 = document.createElement("TR");
        row1.setAttribute("width", "100%");
        row1.setAttribute("id","row1");
        var th1 = document.createElement("TH");
        var th2 = document.createElement("TH");
        var txt1 = document.createTextNode(name);
        var txt2 = document.createTextNode(type);
        th1.setAttribute("width", "20%");
        th2.setAttribute("width", "78%");
        th1.appendChild(txt1);
        th2.appendChild(txt2);
        row1.appendChild(th1);
        row1.appendChild(th2);
        tbox.appendChild(row1);
        var main = document.getElementById("adminwindow");
        main.appendChild(tbox);
        create2 = false;
        generateTable(checkedcmftweets);
    }
}


function generateTable(data) {
    var main = document.getElementById("table");
    // clearTable(main);
    //alert(data[0]);
    console.log(data.length);
    for (var i = 0; i < data.length; i++) {
        var rows = document.createElement("TR");
        rows.setAttribute("width", "100%");
        var cell1 = document.createElement("TD");
        cell1.setAttribute("width", "20%");
        var cell2 = document.createElement("TD");
        cell2.setAttribute("width", "78%");
        cell1.innerHTML = i+1;
        cell2.innerHTML = data[i];
        rows.appendChild(cell1);
        rows.appendChild(cell2);
        main.appendChild(rows);
    }

}

function generateTable2(data) {
    var main = document.getElementById("table");
    //clearTable(main);
    //alert(data[0]);
    console.log(data.length);
    for (var i = 0; i < data.length; i++) {
        var rows = document.createElement("TR");
        rows.setAttribute("width", "100%");
        var cell1 = document.createElement("TD");
        cell1.setAttribute("width", "20%");
        var cell2 = document.createElement("TD");
        cell2.setAttribute("width", "78%");
        cell1.innerHTML = i+1;
        cell2.innerHTML = data[0];
        rows.appendChild(cell1);
        rows.appendChild(cell2);
        main.appendChild(rows);
    }

}


function clearTable() {
    // for (var i = table.rows.length - 1; i > 0; i--) {
    //     table.deleteRow(i);
    // }
    var state = document.getElementById("adminwindow");
    state.innerHTML = "";
    create = true;
    create2 = true;
}

function showSMF() {
    clearTable();
    getTweets();
    makeTable("Number", "Tweet");

}

function showCMF() {
    var dat = localStorage.getItem("customerfb");
    customerfb = dat.split(",");
    checkCMF(customerfb);
    clearTable();
    makecfmTable("Number", "Feedback");


}

function getFeedback() {
    input = document.getElementById("customerinput").value;
    //alert(input);
    customerfb.push(input);
    localStorage.setItem("customerfb", customerfb);
}

